import React from "react";

export default function Greet() {
  return (
    <div>
      <section className="greet">
        <h2>Hi, I'm Luka. Nice to meet you.</h2>
        <p>
          I have a passion for creating beautiful and functional websites that
          not only look great but also perform seamlessly. I continually work to
          hone my skills in various programming languages and frameworks to
          deliver top-notch results for my clients. Whether the project is small or large, I am committed to providing you
          with the best possible service and exceeding your expectations. Let's
          work together to bring your vision to life and create an online
          presence that truly represents your brand.
        </p>
      </section>
    </div>
  );
}
